import ReactDOM from "react-dom/client";
import React from "react";

function Footer() {
  return (
    <div>
      <footer className="footer p-10 bg-base-200 text-neutral-content">
        <div>
          <span className="footer-title">This site is developed and designed by me, it was fun.</span>
          <a className="link link-hover">Icons Courtesy of icons8.com, images</a>
          <a className="link link-hover">Design</a>
          <a className="link link-hover">Marketing</a>
          <a className="link link-hover">Advertisement</a>
        </div>
        
      </footer>
    </div>
  );
}

export default Footer;
